function continuousSubarrays(nums: number[]): number {
  let count = 0;
  let left = 0; // Left boundary of the sliding window
  let max = nums[0], min = nums[0]; // Track the max and min within the window

  for (let right = 0; right < nums.length; right++) {
    // Update max and min for the current window
    max = Math.max(max, nums[right]);
    min = Math.min(min, nums[right]);

    // If the window becomes invalid, move the left boundary right
    while (max - min > 2) {
      left++;
      // Update max and min after removing the leftmost element
      max = Math.max(...nums.slice(left, right + 1));
      min = Math.min(...nums.slice(left, right + 1));
    }

    // All subarrays ending at 'right' and starting from 'left' to 'right' are valid
    count += right - left + 1;
  }

  return count;
}
